import React, { Fragment } from "react";
import Button from "@material-ui/core/Button";
import FacebookIcon from "@material-ui/icons/Facebook";
import TwitterIcon from "@material-ui/icons/Twitter";
import InstagramIcon from "@material-ui/icons/Instagram";
import "./footer.scss";

export const Footer = () => {
  return (
    <Fragment>
      <div id="footer" className="box flex-container">
        <div className="flex-container footer-info-container left-container">
          <Button variant="contained">Logo</Button>
          <p className="SecondLineTexttt">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua.
          </p>
        </div>
        <div className="flex-container footer-info-container right-info ">
          <div className="flex-container links-container">
            <p>¿Quiénes somos?</p>
            <p>Acerca de</p>
            <p>FAQ</p>
            <p>Login</p>
            <button className="buttonDown">Sing up</button>
          </div>
          <div className="flex-container social-links-container">
            <FacebookIcon className="secondLineIcons" />
            <TwitterIcon className="secondLineIcons" />
            <InstagramIcon className="secondLineIcons" />
          </div>
        </div>
      </div>
    </Fragment>
  );
};
